Here are the following changes to the {{ti info -t ios -o json}} output.

1. The {{detectVersion}} has been incremented to {{5.0}}

2. For iOS Simulators, the {{watchCompanion}} property has changed. Before it was an object where the key was the compatible watch sim udid and the value was the watch sim info. This is wrong and didn't take into account that device pairs are Xcode version dependent. Here's the new format:

{code}
"watchCompanion": {
	"7.3.1:7D1014": {
		"04324590-A357-4D79-955A-1B257E4FB113": { <snip> },
		"2DB158C6-4262-4436-BD28-F22283ED8A93": { <snip> },
		"0840F627-0EC3-4DDD-8E27-E4EF33A742FD": { <snip> },
		"2CF58288-AFDB-4424-91F4-ED2F7071745E": { <snip> },
		"1030CB19-E41D-4D55-89FD-97BFE2830250": { <snip> },
		"85AA9683-75E7-4C94-BC36-07DD01F1A8B0": { <snip> }
	},
	"8.0:8A218a": {
		"0840F627-0EC3-4DDD-8E27-E4EF33A742FD": { <snip> },
		"2CF58288-AFDB-4424-91F4-ED2F7071745E": { <snip> },
		"1030CB19-E41D-4D55-89FD-97BFE2830250": { <snip> },
		"85AA9683-75E7-4C94-BC36-07DD01F1A8B0": { <snip> }
	}
}
{code}

The keys are now the Xcode IDs ({{<xcode version>:<xcode build>}}). The value is the same as before where it is an object of watch sim udids to watch sim info objects. You must look up the watch sim info using the udid to determine a specific watch sim's name and watchos version.

3. Each detected Xcode version's info now has a {{simDevicePairs}} property. This exists for internal use, but may come in handy, especially to verify the logic used in determining the device pairs.

4. Added a new top-level iOS info property {{iosSDKtoXcode}}. This is a map of iOS SDKs to the preferred Xcode version ID.

{code}
"iosSDKtoXcode": {
	"10.0": "8.0:8A218a",
	"9.3": "7.3.1:7D1014"
}
{code}

Titanium doesn't care about specific Xcode versions. It only cares about the iOS SDK version you want to compile with. Since the device pairs are Xcode specific, you need to look at {{iosSDKtoXcode}} to determine the correct Xcode.

Steps to determine device pairs:
# Determine the iOS SDK that will be used to compile the app. Defaults to latest iOS SDK version.
# Look up Xcode ID in {{iosSDKtoXcode}} using the iOS SDK version
# For each iOS simulator, the valid list of compatible watch sim udids can be found by look at the {{watchCompanion\[<xcode id>\]}}

I have updated the timob PRs to use the new ioslib@0.15.0. I've gone back to the original format of {{watchCompanion}}, but still group by Xcode IDs. I've updated the comment above, but I'll reiterate:

{code}
"watchCompanion": {
	"7.3.1:7D1014": {
		"04324590-A357-4D79-955A-1B257E4FB113": { <snip> },
		"2DB158C6-4262-4436-BD28-F22283ED8A93": { <snip> },
		"0840F627-0EC3-4DDD-8E27-E4EF33A742FD": { <snip> },
		"2CF58288-AFDB-4424-91F4-ED2F7071745E": { <snip> },
		"1030CB19-E41D-4D55-89FD-97BFE2830250": { <snip> },
		"85AA9683-75E7-4C94-BC36-07DD01F1A8B0": { <snip> }
	},
	"8.0:8A218a": {
		"0840F627-0EC3-4DDD-8E27-E4EF33A742FD": { <snip> },
		"2CF58288-AFDB-4424-91F4-ED2F7071745E": { <snip> },
		"1030CB19-E41D-4D55-89FD-97BFE2830250": { <snip> },
		"85AA9683-75E7-4C94-BC36-07DD01F1A8B0": { <snip> }
	}
}
{code}

This means that there is no longer an array of watch sim udids that I introduced in an earlier commit in this ticket. This also simplifies the process of finding compatible watch sims since you no longer need to go fetch the watch sim info in order to determine the name and version.
